@Test
    public void validConversions() throws Exception {
        for (TypeConverter pc : pcs) {
            // check that the registry has this class
            Object obj = pc.convert("0");
            Assert.assertEquals(obj, TypeConverterUtil.convert("0", obj.getClass()));
            Assert.assertEquals(Double.valueOf(0), pc.convert("0"));
            Assert.assertEquals(Double.valueOf(0), pc.convert("0.0"));
            Assert.assertEquals(Double.valueOf(1.14d), pc.convert("1.14"));
            Assert.assertEquals(Double.valueOf(-2147483648), pc.convert("-2147483648"));
            Assert.assertEquals(Double.valueOf(2147483647), pc.convert("2147483647"));
        }
    }

